INSERT INTO `markdowns` (`id`, `doctorId`, `clinicId`, `specialtyId`, `contentHTML`, `contentMarkdown`, `description`, `createdAt`, `updatedAt`) VALUES
(1, 4, NULL, NULL, '<p><strong>Bác sĩ Chuyên khoa II Trần Minh Khuyên</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Trần Minh Khuyên**\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n**Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n**Quá trình công tác**\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n**Khám và điều trị**\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', '2022-06-05 20:37:19', '2022-06-08 20:47:47'),
(2, 6, NULL, NULL, '<p><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng</strong></p>\n<ul>\n<li>Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</li>\n<li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li>\n<li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li>\n<li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li>\n<li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li>\n<li>Tổng thư ký hội Da liễu Việt Nam</li>\n<li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li>\n<li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li>\n<li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1977)</li>\n</ul>\n<p><strong>Phó Giáo sư khám và điều trị</strong></p>\n<p>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</p>\n<ul>\n<li>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</li>\n<li>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</li>\n<li>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</li>\n<li>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</li>\n<li>Viêm da cơ địa trẻ em và người lớn</li>\n<li>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</li>\n<li>Tổ đỉa</li>\n<li>Mày đay</li>\n<li>Bạch biến</li>\n<li>Vảy nến</li>\n<li>Rụng tóc</li>\n<li>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</li>\n<li>Zona, Thủy đậu, Herpes</li>\n<li>Ghẻ</li>\n<li>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</li>\n<li>Viêm mao mạch dị ứng</li>\n<li>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</li>\n<li>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</li>\n<li>Một số bệnh lông - tóc - móng</li>\n<li>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</li>\n<li>Tiêm tái sinh nang tóc</li>\n</ul>\n<p><strong>Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu</strong></p>\n', '**Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng**\n\n* Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu\n* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n* Tổng thư ký hội Da liễu Việt Nam\n* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\n* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\n* Tốt nghiệp Đại học Y Hà Nội (1977)\n\n**Phó Giáo sư khám và điều trị**\n\nCác bệnh lý về chuyên sâu về da liễu người lớn và trẻ em\n\n* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)\n* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá\n* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da\n* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm\n* Viêm da cơ địa trẻ em và người lớn\n* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu\n* Tổ đỉa\n* Mày đay\n* Bạch biến\n* Vảy nến\n* Rụng tóc\n* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ\n* Zona, Thủy đậu, Herpes\n* Ghẻ\n* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc\n* Viêm mao mạch dị ứng\n* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc\n* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã\n* Một số bệnh lông - tóc - móng\n* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\n* Tiêm tái sinh nang tóc\n\n**Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu**', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nTổng thư ký hội Da liễu Việt Nam', '2022-06-05 20:39:06', '2022-06-08 20:47:26'),
(3, 2, NULL, NULL, '<p><strong>Bác sĩ Chuyên khoa I Ngô Đức Trường</strong></p>\n<ul>\n<li>Bác sĩ từng công tác tại Bệnh viện Phương Đông - 79 Thành Thái, P14, Q10, Tp. HCM</li>\n<li>Bác sĩ có kinh nghiệm trên 25 năm về chuyên khoa Thần kinh - Cột sống</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Khoa thần kinh, Bệnh viện Đa khoa Bình Thuận (1994 - 2008)</li>\n<li>Bác sĩ tại Bệnh viện Phương Đông – 79 Thành Thái, Phường 14, Quận 10, Tp. Hồ Chí Minh (2008 - 2009)</li>\n<li>Bác sĩ tham gia khám chữa bệnh tại Phòng khám Quốc tế EXSON (2009 - nay)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ đa khoa, Đại học Y Huế (1994)</li>\n<li>Tốt nghiệp bác sĩ chuyên khoa I Ngoại Thần kinh tại Đại học Y dược Tp. Hồ Chí Minh (2000)</li>\n<li>Chứng chỉ trong nước hoặc nước ngoài</li>\n<li>Chứng chỉ thực hành về sử dụng dụng cụ tốc độ cao trong phẫu thuật thần kinh, cột sống cấp ngày 19-02-2009 tại Bệnh viện Chợ Rẫy</li>\n<li>Chứng chỉ thực hành về thay đĩa đệm nhân tạo cổ, cấp ngày 19-06-2009 tại Chulalongkorn, Thailand</li>\n<li>Chứng chỉ thực hành tạo hình đột sống bằng Balloon Kyphoplasty cấp ngày 27-09 2009 tại Singapore General Hospital</li>\n<li>Chứng chỉ AOSpine 12-2013 tại TP Hồ Chí Minh</li>\n<li>Chứng chỉ “Phẫu thuật nền sọ và nẹp vít cột sống” năm 2014 do các chuyên gia nước ngoài hướng dẫn trong khóa học tại Bệnh viện Y dược TP Hồ Chí Minh và Hội phẫu thuật thần kinh phối hợp đào tạo</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Các bệnh lý thần kinh, các chứng đau dây thần kinh</li>\n<li>Các bệnh đau đầu, đau nửa đầu, nhức đầu, chóng mặt</li>\n<li>Hội chứng tiền đình</li>\n<li>Bệnh động kinh, mạch máu não, các bệnh về sa sút trí tuệ</li>\n<li>Chóng mặt, ù tai do hội chứng tiền đình Mất ngủ kéo dài, suy nhược thần kinh</li>\n<li>Rối loạn thần kinh thực vật: mệt mỏi, hồi hộp, vã mồ hôi, tụt huyết áp</li>\n<li>Đau thần kinh do zona</li>\n<li>Đau dây thần kinh mặt, hầu họng</li>\n<li>Mọi chứng bệnh thần kinh khác do sang chấn, tai nạn, nhiễm trùng, nhiễm độc</li>\n<li>Các bệnh lý liên quan đến tủy sống và thần kinh ngoại biên</li>\n<li>Tổn thương dây thần kinh số V, VII</li>\n<li>Phẫu thuật u não và u tủy sống</li>\n<li>Phẫu thuật vết thương và chấn thương dây thần kinh ngoại vi</li>\n<li>Đau thần kinh cổ vai cánh tay</li>\n<li>Điều trị các bệnh viêm, thoái hóa cột sống và xương khớp</li>\n<li>Phẫu thuật tạo hình chấn thương sọ não, cột sống, tủy sống</li>\n<li>Phẫu thuật thoát vị đĩa đệm cột sống cổ và thắt lưng</li>\n<li>Đau thần kinh chi dưới, đau thắt lưng cùng</li>\n<li>Liệt 2 chân, liệt 1/2 người</li>\n<li>Vận động tay chân khó khăn, không chính xác, run các chi, run toàn thân</li>\n<li>Liệt hầu họng, nói khó, nuốt nghẹn, sặc, liệt mắt nhìn đôi</li>\n<li>Tai biến mạch máu não do huyết áp cao, đái đường, giai đoạn mới, di chứng</li>\n</ul>\n', '**Bác sĩ Chuyên khoa I Ngô Đức Trường**\n\n* Bác sĩ từng công tác tại Bệnh viện Phương Đông - 79 Thành Thái, P14, Q10, Tp. HCM\n* Bác sĩ có kinh nghiệm trên 25 năm về chuyên khoa Thần kinh - Cột sống\n\n**Quá trình công tác**\n\n* Khoa thần kinh, Bệnh viện Đa khoa Bình Thuận (1994 - 2008)\n* Bác sĩ tại Bệnh viện Phương Đông – 79 Thành Thái, Phường 14, Quận 10, Tp. Hồ Chí Minh (2008 - 2009)\n* Bác sĩ tham gia khám chữa bệnh tại Phòng khám Quốc tế EXSON (2009 - nay)\n\n**Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ đa khoa, Đại học Y Huế (1994)\n* Tốt nghiệp bác sĩ chuyên khoa I Ngoại Thần kinh tại Đại học Y dược Tp. Hồ Chí Minh (2000)\n* Chứng chỉ trong nước hoặc nước ngoài\n* Chứng chỉ thực hành về sử dụng dụng cụ tốc độ cao trong phẫu thuật thần kinh, cột sống cấp ngày 19-02-2009 tại Bệnh viện Chợ Rẫy\n* Chứng chỉ thực hành về thay đĩa đệm nhân tạo cổ, cấp ngày 19-06-2009 tại Chulalongkorn, Thailand\n* Chứng chỉ thực hành tạo hình đột sống bằng Balloon Kyphoplasty cấp ngày 27-09 2009 tại Singapore General Hospital\n* Chứng chỉ AOSpine 12-2013 tại TP Hồ Chí Minh\n* Chứng chỉ “Phẫu thuật nền sọ và nẹp vít cột sống” năm 2014 do các chuyên gia nước ngoài hướng dẫn trong khóa học tại Bệnh viện Y dược TP Hồ Chí Minh và Hội phẫu thuật thần kinh phối hợp đào tạo\n\n**Khám và điều trị**\n\n* Các bệnh lý thần kinh, các chứng đau dây thần kinh\n* Các bệnh đau đầu, đau nửa đầu, nhức đầu, chóng mặt\n* Hội chứng tiền đình\n* Bệnh động kinh, mạch máu não, các bệnh về sa sút trí tuệ\n* Chóng mặt, ù tai do hội chứng tiền đình Mất ngủ kéo dài, suy nhược thần kinh\n* Rối loạn thần kinh thực vật: mệt mỏi, hồi hộp, vã mồ hôi, tụt huyết áp\n* Đau thần kinh do zona\n* Đau dây thần kinh mặt, hầu họng\n* Mọi chứng bệnh thần kinh khác do sang chấn, tai nạn, nhiễm trùng, nhiễm độc\n* Các bệnh lý liên quan đến tủy sống và thần kinh ngoại biên\n* Tổn thương dây thần kinh số V, VII\n* Phẫu thuật u não và u tủy sống\n* Phẫu thuật vết thương và chấn thương dây thần kinh ngoại vi\n* Đau thần kinh cổ vai cánh tay\n* Điều trị các bệnh viêm, thoái hóa cột sống và xương khớp\n* Phẫu thuật tạo hình chấn thương sọ não, cột sống, tủy sống\n* Phẫu thuật thoát vị đĩa đệm cột sống cổ và thắt lưng\n* Đau thần kinh chi dưới, đau thắt lưng cùng\n* Liệt 2 chân, liệt 1/2 người\n* Vận động tay chân khó khăn, không chính xác, run các chi, run toàn thân\n* Liệt hầu họng, nói khó, nuốt nghẹn, sặc, liệt mắt nhìn đôi\n* Tai biến mạch máu não do huyết áp cao, đái đường, giai đoạn mới, di chứng', 'Bác sĩ từng công tác tại Bệnh viện Phương Đông - 79 Thành Thái, P14, Q10, Tp. HCM\nBác sĩ có gần 30 năm kinh nghiệm về chuyên khoa Thần kinh - Cột sống', '2022-06-10 22:31:27', '2022-06-10 22:31:27'),
(4, 9, NULL, NULL, '<p><strong>Tiến sĩ, Bác sĩ Trần Thị Hà An</strong></p>\n<ul>\n<li>Hiện là Phó viện trưởng Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai</li>\n<li>Nguyên Trưởng phòng Thăm dò chức năng</li>\n<li>Nguyên Phó trưởng phòng Tư vấn và Điều trị ngoại trú</li>\n<li>Tốt nghiệp bác sĩ Nội trú bệnh viện, Chuyên ngành Tâm thần</li>\n<li>Bác sĩ khám cho người bệnh từ 6 tuổi trở lên</li>\n<li>Bác sĩ không nhận tư vấn tâm lý</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Bác sỹ Đa Khoa, Đại học Y Hà Nội (1996 – 2002)</li>\n<li>Hoàn thành lớp chuyên khoa định hướng Chuyên ngành Tâm thần (2002 – 2003)</li>\n<li>Tốt nghiệp bác sỹ Nội trú bệnh viện, Chuyên ngành Tâm thần (2003 – 2006)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Bác sỹ điều trị, Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai (2/2007 – 2009)</li>\n<li>Trưởng phòng Thăm dò chức năng, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2009 – 2011)</li>\n<li>Phó trưởng phòng Tư vấn và Điều trị ngoại trú, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2011 – 2015)</li>\n<li>Phó trưởng Phòng Điều trị Tâm thần Nhi và Người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2015 – 5/2017)</li>\n<li>Trưởng phòng Điều trị Tâm thần người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (6/2017 đến nay)</li>\n<li>Thành viên các Hội khoa học, tổ chức chuyên môn</li>\n<li>Thành viên Hội Tâm thần học Việt Nam</li>\n</ul>\n<p><strong>Lưu ý:</strong></p>\n<ul>\n<li>Hiện tại Phòng khám chưa chia giờ chính xác cho bệnh nhân, bệnh nhân nào tới trước sẽ khám trước.</li>\n<li>Thời gian bác sĩ nhận bệnh nhân: Sáng từ 9h đến 11h; chiều từ 16h45 đến 19h</li>\n</ul>\n<p><strong>Khám, tư vấn, và điều trị</strong></p>\n<ul>\n<li>Mất ngủ</li>\n<li>Suy giảm nhận thức và sa sút trí tuệ ở người cao tuổi</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Rối loạn liên quan stress, căng thẳng</li>\n<li>Rối loạn cảm xúc và hành vi ở trẻ em và thanh thiếu niên</li>\n<li>Rối loạn tâm thần người trưởng thành</li>\n<li>Trầm cảm</li>\n<li>Rối loạn lo âu</li>\n<li>Rối loạn lưỡng cực</li>\n<li>Rối loạn cảm xúc khác</li>\n<li>Rối loạn căng thẳng sau chấn thương tâm lý</li>\n<li>Bệnh hoang tưởng</li>\n<li>Rối loạn ám ảnh</li>\n<li>Rối loạn dạng cơ thể</li>\n<li>Tâm thần phân liệt</li>\n</ul>\n<p><strong>Một số triệu chứng, biểu hiện sau:</strong></p>\n<ul>\n<li>Ảo giác, hoang tưởng</li>\n<li>Bi quan, buồn rầu</li>\n<li>Đập phá đồ đạc</li>\n<li>Hành vi hung hăng</li>\n<li>Hay tức giận</li>\n<li>Hoảng hốt</li>\n<li>Khó tập trung tâm trí</li>\n<li>Khóc cười vô cớ</li>\n<li>Kích động</li>\n<li>Lo âu, lo lắng</li>\n<li>Mất tập trung</li>\n<li>Nghiện ngập rượu, ma túy, nghiện game, nghiện internet</li>\n<li>Nhầm lẫn tư duy</li>\n<li>Nói cười một mình</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Sợ hãi, sợ một mình, sợ đông người</li>\n<li>Tuyệt vọng, suy nghĩ tự sát</li>\n<li>Trầm cảm</li>\n<li>Xa lánh mọi người</li>\n<li>Ý nghĩ kì lạ</li>\n<li>Stress</li>\n<li>Rối loạn lo âu</li>\n<li>Suy giảm trí nhớ</li>\n<li>Đau, rối loạn dạ dày ruột, rối loạn nhịp tim… lặp đi lặp lại nhiều lần mà không xét nghiệm thấy tổn thương tương ứng</li>\n</ul>\n', '**Tiến sĩ, Bác sĩ Trần Thị Hà An**\n\n* Hiện là Phó viện trưởng Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai\n* Nguyên Trưởng phòng Thăm dò chức năng\n* Nguyên Phó trưởng phòng Tư vấn và Điều trị ngoại trú\n* Tốt nghiệp bác sĩ Nội trú bệnh viện, Chuyên ngành Tâm thần\n* Bác sĩ khám cho người bệnh từ 6 tuổi trở lên\n* Bác sĩ không nhận tư vấn tâm lý\n\n**Quá trình đào tạo**\n\n* Bác sỹ Đa Khoa, Đại học Y Hà Nội (1996 – 2002)\n* Hoàn thành lớp chuyên khoa định hướng Chuyên ngành Tâm thần (2002 – 2003)\n* Tốt nghiệp bác sỹ Nội trú bệnh viện, Chuyên ngành Tâm thần (2003 – 2006)\n\n**Quá trình công tác**\n\n* Bác sỹ điều trị, Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai (2/2007 – 2009)\n* Trưởng phòng Thăm dò chức năng, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2009 – 2011)\n* Phó trưởng phòng Tư vấn và Điều trị ngoại trú, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2011 – 2015)\n* Phó trưởng Phòng Điều trị Tâm thần Nhi và Người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2015 – 5/2017)\n* Trưởng phòng Điều trị Tâm thần người già, Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai (6/2017 đến nay)\n* Thành viên các Hội khoa học, tổ chức chuyên môn\n* Thành viên Hội Tâm thần học Việt Nam\n\n**Lưu ý:**\n\n* Hiện tại Phòng khám chưa chia giờ chính xác cho bệnh nhân, bệnh nhân nào tới trước sẽ khám trước.\n* Thời gian bác sĩ nhận bệnh nhân: Sáng từ 9h đến 11h; chiều từ 16h45 đến 19h\n\n**Khám, tư vấn, và điều trị**\n* Mất ngủ\n* Suy giảm nhận thức và sa sút trí tuệ ở người cao tuổi \n* Rối loạn giấc ngủ\n* Rối loạn liên quan stress, căng thẳng\n* Rối loạn cảm xúc và hành vi ở trẻ em và thanh thiếu niên\n* Rối loạn tâm thần người trưởng thành\n* Trầm cảm\n* Rối loạn lo âu \n* Rối loạn lưỡng cực \n* Rối loạn cảm xúc khác\n* Rối loạn căng thẳng sau chấn thương tâm lý \n* Bệnh hoang tưởng\n* Rối loạn ám ảnh\n* Rối loạn dạng cơ thể\n* Tâm thần phân liệt\n\n**Một số triệu chứng, biểu hiện sau:**\n\n* Ảo giác, hoang tưởng \n* Bi quan, buồn rầu \n* Đập phá đồ đạc\n* Hành vi hung hăng\n* Hay tức giận\n* Hoảng hốt\n* Khó tập trung tâm trí\n* Khóc cười vô cớ\n* Kích động\n* Lo âu, lo lắng \n* Mất tập trung\n* Nghiện ngập rượu, ma túy, nghiện game, nghiện internet\n* Nhầm lẫn tư duy\n* Nói cười một mình\n* Rối loạn giấc ngủ\n* Sợ hãi, sợ một mình, sợ đông người\n* Tuyệt vọng, suy nghĩ tự sát\n* Trầm cảm\n* Xa lánh mọi người\n* Ý nghĩ kì lạ \n* Stress\n* Rối loạn lo âu\n* Suy giảm trí nhớ\n* Đau, rối loạn dạ dày ruột, rối loạn nhịp tim… lặp đi lặp lại nhiều lần mà không xét nghiệm thấy tổn thương tương ứng', 'Hiện là Phó viện trưởng Viện sức khoẻ Tâm thần, Bệnh viện Bạch Mai\nThành viên Hội Tâm thần học Việt Nam\nBác sĩ khám cho người bệnh từ 6 tuổi trở lên\nBác sĩ không nhận tư vấn tâm lý', '2022-06-11 14:55:32', '2022-06-11 14:55:32');

